// src/pages/Home.tsx
import React from "react";
import { Container, Typography, Button, Box } from "@mui/material";
import { useNavigate } from "react-router-dom";
import "./Home.css"; 

const Home: React.FC = () => {
  const navigate = useNavigate();

  return (
    <Container maxWidth="lg" style={{ textAlign: "center", marginTop: "20px" }}>
      <Typography variant="h4" color="primary" gutterBottom>
        LoL Stats Project
      </Typography>
      <Box sx={{ display: "flex", justifyContent: "center", gap: 2, mt: 4 }}>
        <button
          onClick={() => navigate("/statistships/welcome")}
          className="site-selector-btn" 
        >
          Go to Statistships WelcomePage
        </button>
        <Button
          variant="contained"
          color="secondary"
          onClick={() => navigate("/morestats/WelcomePage")}
        >
          Go to Morestats WelcomePage
        </Button>
      </Box>
    </Container>
  );
};

export default Home;
